tables.table_schema:
CREATE TABLE Influencers (
  influencer_id INT PRIMARY KEY,
  influencer_name VARCHAR(50),
  followers_count INT,
  platform VARCHAR(20)
);

CREATE TABLE Brands (
  brand_id INT PRIMARY KEY,
  brand_name VARCHAR(50),
  industry VARCHAR(50)
);

CREATE TABLE influencers (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    followers INT,
    collaborations INT
);

CREATE TABLE bloggers (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    followers INT,
    sponsored_content INT
);

CREATE TABLE partnerships (
    id INT PRIMARY KEY,
    influencer_id INT,
    blogger_id INT,
    partnership_status VARCHAR(50)
);
